<script>
    //https://my.newtonschool.co/playground/code/qznsydltru6q/
    function removeDuplicates(arr){
      let newTemp=[];
      for(let obj of arr){
        if(newTemp.indexOf(obj)==-1){
            newTemp.push(obj);
        }
      }
      return newTemp.join(' ');
}
console.log(removeDuplicates([1, 2, 3, 5, 1, 5, 9, 1, 2, 8]));
</script>
